class Tree:
    def __init__(self , label:str = '' , parent =None , sons:list = [] , node_type:str = 'leaf' ) -> None:
        self.lab = label
        self.p = parent
        self.s = [ ]
        self.t = node_type
        self.cnt = 0
        pass

    def all_springs_cnt( self ):
        if self.t == 'leaf':
            self.cnt = 1
        else:
            for tmp_son in self.s:
                self.cnt += tmp_son.all_springs_cnt()
        return self.cnt
    
    def __repr__(self) -> str:
        if self.p == None:
            return 'cur_node:%s , parent:%s ,  sons:%s'%( self.lab , 'root' , ', '.join( str(i.lab) for i in self.s ) )
        elif self.t == 'leaf':
            return 'cur_node:%s , parent:%s ,  sons:%s'%( self.lab , 'root' , 'leaf' )
        else:
            return 'cur_node:%s , parent:%s ,  sons:%s'%( self.lab , self.p.lab , ', '.join( str(i.lab) for i in self.s ) )
    
    def get_sub_quartets( self ):
        if self.t == 'leaf':
            return 0
        self.sub_q = 0
        for next_node in self.s:
            self.sub_q +=  next_node.get_sub_quartets()
        if self.p == None:    # need to avoid pairs overlapped
            self.sub_q += ( math.comb( self.cnt - self.s[0].cnt , 2 )* math.comb(  self.s[0].cnt , 2 )   +\
                            math.comb(self.s[1].cnt , 2 )* (math.comb(  self.s[2].cnt , 2 )+  self.s[2].cnt * self.s[0].cnt) +\
                            math.comb(self.s[2].cnt , 2 )* ( self.s[0].cnt * self.s[1].cnt) )
        else:
             self.sub_q += ( math.comb( self.s[0].cnt , 2 )* math.comb(  self.s[1].cnt , 2 )   +\
                            math.comb(self.s[1].cnt , 2 )* ( self.s[0].cnt * (n-self.cnt)) +\
                            math.comb(self.s[0].cnt , 2 )* ( self.s[1].cnt * (n-self.cnt)) )
        return self.sub_q

def parse_nwk( nwk_s:str ) -> dict:
    phylo_dic = collections.defaultdict( Tree )
    internode_cnt = 0
    stack = [ '' ]
    idx = 0
    while idx < len(nwk_s):
        if nwk_s[idx] == ',' or nwk_s[idx] == ';' :
            stack.append( '' )
        elif nwk_s[idx]  == '(':
            stack[-1] += nwk_s[idx] 
            stack.append( '' )
        elif nwk_s[idx]  == ')':
            tmp_id = ''
            while nwk_s[idx+1] != ',' and nwk_s[idx+1] != ';' and nwk_s[idx+1] != ')':
                idx += 1
                tmp_id += nwk_s[idx]

            if tmp_id == '':
                tmp_id = internode_cnt
                internode_cnt += 1
            tmp_node = Tree( label=tmp_id, node_type='inter' , sons=[] )
            phylo_dic[tmp_id] = tmp_node

            tmp_sons = []
            while stack[-1] != '(':
                a = stack.pop()
                if a != '':
                    tmp_sons.append( a ) 
            stack.pop()
            stack.append( tmp_node )

            for son in tmp_sons:
                son_node = son
                if type(son) == str:
                    son_node = Tree( label=son , node_type='leaf' , parent=tmp_node)
                    phylo_dic[son] = son_node
                tmp_node.s.append( son_node )
                son_node.p = tmp_node
        else:
            stack[-1] += nwk_s[idx] 
        idx += 1
    
    return phylo_dic , tmp_node



